import React from 'react';
import Footer from './Footer';
import { Routes, Outlet } from 'react-router-dom'
import Header from './Header';


function Container() {
    return (
        <div>
            <Routes></Routes>
            <Header />
            <Outlet />
            <Footer />
        </div>
    )
};

export default Container
